import React from "react";
import { Outlet } from "react-router";
import Log from "../components/Log";
import Poke from "../components/Poke";

const Authenticationlayout =()=>{
    return(
        <div>
            <nav className='bg-white w-full h-full'> 
            <div className="flex items-center justify-between p-5 h-20">
            <Log class='absolute h-10 w-10'/>
            <Poke/>
            <div className="rounded-full bg-pink-500 w-10 h-10"></div>
            </div>

</nav>
           <div className='bg-slate-300 h-screen justify-center'>
            <Outlet />
            </div>


        </div>
    )
}
export default Authenticationlayout;
